import styled from "styled-components";

export interface props {
  marginLeft?: any;
  width?: any;
  flex?: any;
}
export const Flex = styled.div<props>`
    display: flex;
    margin-Left : ${p => p.marginLeft ? p.marginLeft : ""};
`
